export default {
    data(){
        return  [
            {
                "id": 1,
                "value": "institutionId",
                "type": "String(64)",
                "required": "M",
                "desc": "机构号"
            },
            {
                "id": 2,
                "value": "subClientId",
                "type": "String(64)",
                "required": "C",
                "desc": "子商户clientId,新增可以不传，传入则代表更新此条数据"
            },
            {
                "id": 3,
                "value": "merchantClientId",
                "type": "String(64)",
                "required": "M",
                "desc": "机构侧的商户唯一标识"
            },
            {
                "id": 4,
                "value": "notifyUrl",
                "type": "String(255)",
                "required": "M",
                "desc": "异步通知地址"
            },
            {
                "id": 5,
                "value": "industryType",
                "type": "String(64)",
                "required": "M",
                "desc": "贸易类型 Goods-货物贸易 Service-服务贸易"
            },
            {
                "id": 24,
                "value": "signType",
                "type": "String(32)",
                "required": "M",
                "desc": "签名类型 MD5/SHA256"
            },
            {
                "id": 25,
                "value": "sign",
                "type": "String(128)",
                "required": "M",
                "desc": "签名"
            }
        ]
    }
}
